import React from 'react';
import Footer from '../Footer/Footer';
import Header from '../Header/Header';
import Router from '../router/Routers';

const Layout = () => {
  return (
    <>
      <Header/>
      <Router/>
      <Footer/>
    </>
  );
}

export default Layout;
